### Describe the issue

I'm providing a standalone C program which imports a yolov4 model, runs it with the default execution provider and measures the evaluation timing. When ORT is built without the `NDEBUG` flag I get around 200ms, with `NDEBUG` timings increase to around 850ms. The slowdown is not specific to this model, I see an increase from 4x to 10x across several models. This happens on Linux and Mac (both pre and post ARM switch), while on Windows timings are always on the fast side regardless of the flag (similar timings as Linux with no `NDEBUG` flag on the same machine). I'm using ORT commit baeece44ba075009c6bfe95891a8c1b3d4571cb3  (v1.15.1 release tag).

### To reproduce

Program:
```
#include <iostream>
#include <chrono>

#include "onnxruntime/core/session/onnxruntime_c_api.h"

int main(int argc, char *argv[]) {

  // Initialization
  const OrtApi* ort_api = OrtGetApiBase()->GetApi(ORT_API_VERSION);

  OrtEnv* ort_env;
  OrtThreadingOptions *threading_options;
  ort_api->CreateThreadingOptions(&threading_options);
  ort_api->CreateEnvWithGlobalThreadPools(
    ORT_LOGGING_LEVEL_FATAL, 
    "global_glob_ort_env", 
    threading_options, 
    &ort_env
  );
  ort_api->ReleaseThreadingOptions(threading_options);

  OrtAllocator* allocator;
  ort_api->GetAllocatorWithDefaultOptions(&allocator);

  OrtSessionOptions* session_options;
  ort_api->CreateSessionOptions(&session_options);
  ort_api->DisablePerSessionThreads(session_options);

  // Import model
  OrtSession *session;
  OrtStatus *status = ort_api->CreateSession(
    ort_env, 
    "yolov4.onnx", 
    session_options, 
    &session
  );

  // Create input
  OrtValue *input;
  int64_t dims[] = {1, 416, 416, 3};
  ort_api->CreateTensorAsOrtValue(
    allocator,
    dims,
    4,
    ONNX_TENSOR_ELEMENT_DATA_TYPE_FLOAT,
    &input
  );

  // Run Session
  char const* input_names[] = {"input_1:0"};
  char const* output_names[] = { "Identity:0", "Identity_1:0", "Identity_2:0"};
  OrtValue* outputs[] = {nullptr, nullptr, nullptr};
  auto start = std::chrono::high_resolution_clock::now();
  ort_api->Run(
    session,
    nullptr,
    input_names,
    &input,
    1,
    output_names,
    3,
    outputs
  );
  auto stop = std::chrono::high_resolution_clock::now();
  auto duration = std::chrono::duration_cast<std::chrono::milliseconds>(stop - start);
 
  std::cout << "Evaluation time: " << duration.count() << "\n";

}
```

Program build on Linux (need to set set `ort_dir`):
```
gcc main.cpp -o program \
	-I$ort_dir/include \
	-L$ort_dir/lib \
	-lonnxruntime \
	-lstdc++ \
	-Wno-unused-result \
	-Wl,-rpath $ort_dir/lib
```

ORT build with `NDEBUG` flags (need to set `output_dir` and `ort_source_dir`):
```
cmake --compile-no-warning-as-error \
 -DCMAKE_INSTALL_PREFIX=$output_dir \
 -DCMAKE_BUILD_TYPE=Release \
 -DCMAKE_SKIP_BUILD_RPATH=On \
 -DCMAKE_C_FLAGS_RELEASE="-DNDEBUG" \
 -DCMAKE_CXX_FLAGS_RELEASE="-DNDEBUG" \
 -Donnxruntime_BUILD_SHARED_LIB=ON \
 -Donnxruntime_USE_TELEMETRY=OFF \
 -Donnxruntime_ENABLE_CPU_FP16_OPS=OFF \
 -Donnxruntime_BUILD_UNIT_TESTS=OFF \
 -Donnxruntime_DISABLE_RTTI=OFF \
 $ort_source_dir/cmake

cmake --build . --config Release --target install
```

